【商品説明】<br>強力な除菌・消臭成分を配合しているので、ニオイの発生源である菌を除菌し、気になるニオイを素早く消臭します。カビに対しても抜群の効果を発揮するので、保管の際にスプレーするだけでカビの発生を防ぎます。速乾タイプなので乾燥までの時間を気にせず使用できます。乾燥後も除菌効果が持続します。<br>原産国：日本<br>ブランド：スメルバスター<BR>商品サイズ：53×175×53<br>JANコード：4972444011453<BR>cs：20<BR>商品カテゴリ： カー用品 ＞ オイル　(600100)<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
